import React from 'react';

export const ListFilterEmptyState = () => (
  <div className="description-copy">
    You can use a filter to:
    <br />
    Show tasks assigned to me.
    <br />
    Show only notes with a certain tag.
    <br />
    Hide completed tasks.
  </div>
);
